import React, { useState } from 'react'

const App = () => {
    const [Name,setName] = useState('');
    const inputEvent = (event) =>{
        setName(event.target.value);
    }
    return(<>
    <div>
        <h1>Hello {Name}</h1>
        <input type="text" placeholder="Enter Your Name" onChange={inputEvent}/>
        <button>Click Me 👍🏻</button>
    </div>
    </>)
};
export default App;
